        <style>
body.list {
  background: radial-gradient(circle, rgba(184,219,252,1) 0%, rgba(42,67,100,1) 100%);
  background-attachment: fixed;
    font-weight: 100;
  padding: 2em;
  font-family: 'bollivia_rosilla_scriptRg', "Goudy Old Style", sans-serif;
  font-size: 1.5em;
  color: rgb(226, 255, 225);
  
}

.gallery-wrapper {
  display: grid;
  grid-template-columns: 1fr;
  grid-gap: 1rem;
  max-width: 1140px;
  margin: auto;
  
}

@media (min-width: 600px) {
  .gallery-wrapper {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-gap: 2rem;
  }
}
  

@media (min-width: 900px) {
  .gallery-wrapper {
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    grid-gap: 1.8rem;
  }
}

.gallery-image img {
  width: 100%;
  margin-top: -.5em;
  
  }
/* motto */
div.motto {
  text-align: center;
  margin-bottom: 4em;
  margin-top: 9em;
  letter-spacing: 0.00625em;
  font-size: 1.3em;
  font-family: 'bollivia_rosilla_scriptRg', "Goudy Old Style" , sans-serif;
  color: rgb(5, 59, 131);
}
/* logo*/
#logo {
  position: absolute;
  width: 100px;
  padding-left: 40px;
  padding-top: 40px;
  margin-bottom: 19px;
}
div.logo{
  position:absolute;
  left:30px;
  top:30px;
}
.menu {
  position: absolute;
  top: 150px;
  right: 50px;
}

li{
  padding-right:40px;
  display:inline;
  
 
  
}
a{
font-size: 1.5em;
font-weight: 300;
color:#fcd2ee;
text-decoration:none;
font-family: 'bollivia_rosilla_scriptRg', "Goudy Old Style", sans-serif;
}
 /* pagination*/
 .pagination {
  display: inline-block;
  margin-top: 5em;
}

.pagination a {
  color: #003866;
  float: left;
  padding: 8px 16px;
  text-decoration: none;
  border: 1px solid #ffffff;
  margin: 0 2px;
  font-size: .8em;
}

.pagination a.active {
  background-color: #a18ca8;
  color: white;
}

.pagination a:hover:not(.active) {
  background-color: #d2d7d3;
}

/* Layout and style */



.container {
  display: flex;
  justify-content: center;
  align-items: center;
  margin-bottom: 6em;
}

.centerl {
  display: block;
  margin: 0 auto;
  width: 800px;
  margin-top: 14em;
  box-shadow: 25px 25px 65px 0px rgba(102, 156, 255, 0.74);
}
.centerp {
  display: block;
  margin: 0 auto;
  width: 422px;
  margin-top: 12.6em;
  box-shadow: 25px 25px 65px 0px rgba(102, 156, 255, 0.74);
}


/* Bio */
.site-wrap {
  /* Critical position and size styles */
  min-height: 100%;
  min-width: 100%;
  
  position: relative;
  top: 0;
  bottom: 100%;
  left: 0;
  z-index: 1;
  
  /* non-critical apperance styles */
  padding: 4em;
  background-size: 200%;
}



/* Additional non-critical styles */

h1, h3, p {
  max-width: 800px;
  margin: 0 auto 1.5em;
  font-family: 'bollivia_rosilla_scriptRg', "Goudy Old Style", sans-serif;
  color: rgb(0, 60, 88);
  font-size: 1.5em;
 
}
.profile {
  
  
  border-radius: 0px;
  padding: 20px;
  margin: 0 auto;
  padding-top: 13em;
  
}

.profile-pic {
  width: 130px;
  border-radius: 150px;
  
}

span {
  font-family: 'bollivia_rosilla_scriptRg', "Goudy Old Style", sans-serif;
  
  font-size: 1.4em;
  color: rgb(226, 255, 225);
}
